// default_designs.js
export const defaultStyles = {
    border: '2px solid #ccc',
    borderRadius: '5px',
    padding: '10px',
    margin: '10px 0',
    fontFamily: 'Arial, sans-serif',
    color: '#333',
  };
  
  export const paragraphStyles = {
    margin: '10px 0',
    lineHeight: '1.5',
  };
  
  export const divStyles = {
    margin: '10px 0',
  };
  
  export const buttonStyles = {
    border: 'none',
    padding: '10px 15px',
    borderRadius: '3px',
    cursor: 'pointer',
  };
  
  export const buttonReadyStyles = {
    ...buttonStyles,
    backgroundColor: 'grey',
    color: 'white',
  };
  
  export const buttonDeleteStyles = {
    ...buttonStyles,
    backgroundColor: 'red',
    color: 'white',
    position: 'absolute',
    top: '10px',
    right: '10px',
  };
